    <>
        <FormContainer>
            <form onSubmit={(event) => handleSubmit}>
                <div className="brand">
                    <img src="https://via.placeholder.com/150" alt="logo" />
                    <h1>Pulsar</h1>
                </div>
                <input type="text" placeholder="Username" name="username" onChange={(e) => handleChange(e)}/>
